import React from 'react';

const Nav = ({ onNavigationClick }) => {
    return (


             <nav style={navbarStyle}>
                <ul>
                    <a style={activeLinkStyle} href="#">UC Merced Greenhouse</a>

                    <li><a  style={linkStyle} onClick={() => onNavigationClick('status')} href="#">Status</a></li>
                    <li><a style={linkStyle} onClick={() => onNavigationClick('requestForm')} href="#">Request Form</a></li>
                </ul>
            </nav>

    );
}

// Define styles
const navbarStyle = {
    backgroundColor: 'white',
    overflow: 'hidden',
};

const activeLinkStyle = {
    float: 'left',
    display: 'block',
    color: 'black',
    textAlign: 'center',
    padding: '14px 20px',
    textDecoration: 'none',
    backgroundColor: 'white',
    fontSize: '20px',
    fontWeight: 'bold',
};

const linkStyle = {
    float: 'left',
    display: 'block',
    color: 'black',
    textAlign: 'center',
    padding: '14px 20px',
    textDecoration: 'none',
};

const adminButtonStyle = {
    float: 'left',
};

export default Nav;
